	public function autorizados () {
		
		if ( $this->executionMode == MODE_WEB ) {
		
			//$this->consultaGruposServcel();
		
		} else {
		
			$objAutorizado = $this->model();
			$objAutorizado->connect('SDW');
				
			foreach ($this->idEstranhos() as $idAutorizado) {
					
				$registro = $objAutorizado->consultaAutorizados( $idAutorizado );
					
				if ( empty ( $registro ) ) {
						
					// var_dump($registro[0]->cn ); echo '<br />';
					$naoEncontrados[] = $idAutorizado;
				}
			}
		
			foreach ( $naoEncontrados as $autorizado ) {
		
				$this->appLog->write($autorizado);
				echo $autorizado . PHP_EOL;
			}
				
			echo count ( $naoEncontrados );
		}
		
	}
	
	
